import React, {useState} from 'react';
import { motion } from "framer-motion"



function App() {
  const [occupied, setOccupied] = useState(false)
  return (
    <motion.div 
    onClick={() => {
      setOccupied(!occupied)
    }}
    whileTap={{ scale: 0.8 }} 
    className=""
    >
      {occupied && <img src={require('./utdvector.png')} />}
      {!occupied && <h1>Empty</h1>}

    </motion.div>
  );
}


function click() {

}

function Button() {
  return (
    <motion.div className="font-semibold text-[#9900ff]  border border-black-500 rounded-full">
      <img>./utdvector.png</img>
    </motion.div>
  );
}


export default App;
